package chapter7.video70;public class CustomerPrinter {    void print(String name) {        System.out.println("name = " + name);    }    void print(String name, int age) {        System.out.println("name = " + name + ", age = " + age);    }    void print(String name, int age, String city) {        System.out.println("name = " + name + ", age = " + age + ", city = " + city);    }}